 */
registerDynImportEntry('js/AwIncludeService', () => import('js/AwIncludeService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "render": {
            "method": "awIncludeRenderFunction",
            "deps": "js/AwIncludeService"
        }
    },
    "data": {},
    "conditions": {},
    "onEvent": [],
    "lifecycleHooks": {
        "render": "render"
    },
    "props": {
        "name": {
            "type": "string"
        },
        "when": {
            "type": "string"
        },
        "view-id": {
            "type": "string"
        },
        "sub-panel-context": {
            "type": "object"
        }
    },
    "_viewModelId": "AwInclude",
    "_uniqueViewModelId": "AwInclude",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awIncludeRenderFunction, undefined, ctxImportObj );

export default Component;
